import {Link} from 'next-routes';
import React from 'react';

const Index = () => {
    return (
        <div>
            <h1>Hello next!</h1>
            <nav>
                <ul>
                    <li>
                        <Link route={"/css"}>
                            <a>Css Test</a>
                        </Link>
                    </li>
                </ul>
            </nav>
        </div>
    )
}

export default Index;
